const con = require('../db');
var QrCode = require("qrcode");
const { createCanvas, loadImage } = require("canvas");

module.exports = {
    getLogo: () => {
        let lg = "data:image/png;base64,"

        return new Promise((resolve, reject) => {
            resolve(lg)
        })
    },
    userlist: () => {
        return new Promise((resolve, reject) => {
            let getData = "SELECT concat(firstname,' ',lastname) as name, api_key from llx_user where employee=1 and api_key is not null order by name";
            con.query(getData, (err, row) => {
                if (!err) {
                    console.log(getData)
                    resolve(row)
                } else {
                    reject(err)
                }
            })
        })
    },
    masteruser: (id) => {
        return new Promise((resolve, reject) => {
            let getData = "SELECT concat(firstname,' ',lastname) as name, job,user_mobile,email from llx_user where employee=1 and api_key='" + id + "'";
            con.query(getData, (err, row) => {
                if (!err) {
                    console.log(getData)
                    resolve(row)
                } else {
                    reject(err)
                }
            })
        })
    },

    create: async(dataForQRcode, center_image, width, cwidth) => {
        const canvas = createCanvas(width, width);
        QrCode.toCanvas(
            canvas,
            dataForQRcode, {
                errorCorrectionLevel: "H",
                margin: 1,
                color: {
                    dark: "#000000",
                    light: "#ffffff",
                },
            }
        );

        const ctx = canvas.getContext("2d");
        const img = await loadImage(center_image);
        const center = (width - cwidth) / 2;
        ctx.drawImage(img, center, center, cwidth, cwidth);
        return canvas.toDataURL("image/png");
    }
}